&lt;p&gt;Two statements are given, followed by two conclusions numbered I and II. Assuming the statements to be true, even if they seem to be at variance with the commonly known facts, decide which of the conclusions logically follow(s) from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements: &lt;/strong&gt;&lt;/p&gt;

